import React, { useState } from 'react';
import axios from 'axios';
import './styles/Loginform.scss';

const LoginFormReact = ({ onLoginSuccess, onContinueAsGuest }) => {
  const [activeTab, setActiveTab] = useState('signin');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [error, setError] = useState(null);

  const handleTabChange = (tab) => {
    setError(null);
    setActiveTab(tab);
    // Clear inputs on tab change
    setUsername('');
    setPassword('');
    setName('');
    setEmail('');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    try {
      if (activeTab === 'signin') {
        // Login request
        const response = await axios.post(`${process.env.REACT_APP_API_BASE_URL}/api/auth/token`, new URLSearchParams({
          username,
          password,
        }), {
          headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
          },
        });
        const token = response.data.access_token;
        localStorage.setItem('access_token', token);
        if (onLoginSuccess) onLoginSuccess(token);
      } else {
        // Registration request
        await axios.post(`${process.env.REACT_APP_API_BASE_URL}/api/auth/register`, {
          username: name,
          password,
          email,
        });
        setActiveTab('signin');
        setError('Регистрация успешна. Пожалуйста, войдите.');
      }
    } catch (err) {
      setError(err.response?.data?.detail || 'Ошибка при запросе');
    }
  };

  return (
    <div className="container">
      <input
        type="radio"
        name="tab"
        id="signin"
        checked={activeTab === 'signin'}
        onChange={() => handleTabChange('signin')}
      />
      <input
        type="radio"
        name="tab"
        id="register"
        checked={activeTab === 'register'}
        onChange={() => handleTabChange('register')}
      />
      <form onSubmit={handleSubmit} className="pages">
        <div className="page">
          <div className="input">
            <input
              className="text"
              type="text"
              placeholder="Логин"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
              autoComplete="username"
            />
          </div>
          <div className="input">
            <input
              className="text"
              type="password"
              placeholder="Пароль"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              autoComplete="current-password"
            />
          </div>
          <div className="input">
            <input type="submit" value="ENTER" />
          </div>
        </div>
        <div className="page signup">
          <div className="input">
            <input
              className="text"
              type="text"
              placeholder="NAME"
              value={name}
              onChange={(e) => setName(e.target.value)}
              required
              autoComplete="name"
            />
          </div>
          <div className="input">
            <input
              className="text"
              type="email"
              placeholder="EMAIL"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              autoComplete="email"
            />
          </div>
          <div className="input">
            <input type="submit" value="SIGN ME UP!" />
          </div>
        </div>
      </form>
      {error && <div className="error">{error}</div>}
      <div className="tabs">
        <label
          htmlFor="signin"
          className="tab"
          onClick={() => handleTabChange('signin')}
        >
          <div className="text">Sign In</div>
        </label>
        <label
          htmlFor="register"
          className="tab"
          onClick={() => handleTabChange('register')}
        >
          <div className="text">Register</div>
        </label>
      </div>
      <button onClick={onContinueAsGuest} className="guestButton" type="button">
        Продолжить без авторизации
      </button>
    </div>
  );
};

export default LoginFormReact;
